export default function MathShow() {
    return (
        <div>
            <h3>Число пи и его друзья:</h3>
            <ul>
                <li>{pi}</li>
                <li>{doublePi()}</li>
                <li>{triplePi()}</li>
            </ul>
        </div>
    );
}
